<>
<h1 className="hello">{`Hello my name is  ${lname}`}</h1>
<img src={img1}alt="randomImage"/>
<img src={img2} alt="randomImage"/>
<a href='https://www.google.com' target='_blank' ><img src={img3 } alt="randomImage" /></a>

 </>,
